import React from "react";

function CreatePost() {
  return (
    <div className="createpost">
      <input type="text" placeholder="title" />
      <input type="url" placeholder="image" />
      <input type="text" placeholder="location" />
      <button>CREATE POST</button>
    </div>
  );
}

export default CreatePost;
